<script>
    export default {
        name: "first-certificate",
        props: {
            information: {
                type: Object,
                default: function () {
                    return null
                }
            },
        },
        data() {
            return {}
        },
        created() {
        },
        computed: {
            title() {
                if (this.information) {
                    return this.information.className
                }
                return null
            },
            subTitle() {
                if (this.information) {
                    return this.information.labName
                }
                return null
            },
            issueDate() {
                if (this.information) {
                    var timeStamp = this.information.when
                    var date = this.convertTimeStampToDate(timeStamp)
                    return date
                }
                return null
            },
            expirationDate() {
                if (this.information) {
                    var timeStamp = this.information.when
                    if (this.information.period) {
                        if (typeof this.information.period == 'string') this.information.period = Number(this.information.period)
                    } else {
                        if (this.information.period == 0) {
                            return ''
                        } else {
                            this.information.period = 90
                        }
                    }

                    var time = this.getExpiredPeriodToTimeStamp(timeStamp, this.information.period)
                    var date = this.convertTimeStampToDate(time)
                    return date
                }
                return null
            },
            issueNum() {
                if (this.information) {
                    return this.information.key ? this.information.key : this.information.certificateKey
                }
                return null
            },
            userName() {
                return this.information.userName ? this.information.userName : localStorage.getItem('userName')
            },
            teacher() {
                if (this.information) {
                    return this.information.teacherId
                }
            },
        },
        methods: {
            convertTimeStampToDate(timeStamp) {
                if (timeStamp) {
                    if (typeof timeStamp == 'string')
                        timeStamp = Number(timeStamp)

                    var date = new Date(timeStamp);
                    var year = date.getFullYear()
                    var month = ("0" + (date.getMonth() + 1)).slice(-2); // 2 (01, 02 ... 12)
                    var day = ("0" + date.getDate()).slice(-2); // 2 (01, 02 ... 31)

                    return year + "." + month + "." + day
                } else {
                    return null
                }
            },
            getExpiredPeriodToTimeStamp(start, period) {
                var me = this
                var getPeriod = period
                if (getPeriod > 365) getPeriod = 365
                console.log(start, start + (getPeriod * 24 * 60 * 60 * 1000), getPeriod)
                return start + (getPeriod * 24 * 60 * 60 * 1000)

            },
        }
    }
</script>